    <h1>做了3个小时,老师您看:</h1>
    <h2>宣言:在一中校园里,常春藤以其顽强的生命力和不屈的精神,生长在红楼的墙壁上,它在逆境中生长,纵然风雨交加,也依然向上攀爬。这正如我们一中学子勇毅的品格。常春藤始终激励着我们:无论学业有多么艰难,亦要像常春藤一样,扎根于广博的知识土壤,怀揣梦想,勇敢探索,奋发求进。就让我们像常春藤一样,在成长的旅途中,不断绽放出属于自己的青春吧。</h2>
    <h2>口号:扎根知识,追求品格;勇毅向上,勃发青春。</h2>
    <h1>by黄正扬</h1>
